import React, { useState } from 'react'
import { Link, Outlet } from 'react-router-dom';
import './Layout.css';
import logo from '../assets/youtube.png';
const Layout = () => {
  let [menu, setMenu] = useState("home");
  return (
    <div>
      <header>
        <img src={logo} alt=''/>
        <nav>
          <ul>
            <li className='' onClick={() => setMenu("home")}><Link to="">Home</Link></li>
            <li className='' onClick={() => setMenu("blog")}><Link to="">Blog</Link></li>
            <li className='' onClick={() => setMenu("contact")}><Link to="">Contact</Link></li>
          </ul>
        </nav>
        <div className='right_section'>
         <button>Login</button>
        </div>
      </header>
      <Outlet/>
    </div>
  )
}

export default Layout;
